import React from "react";
import {Link, Outlet} from "react-router-dom"

class Docs extends React.Component {

    render() {
        return (
            <div>
                <nav>
                    <Link to="me">My Profile</Link>
                </nav>

                <Outlet />
            </div>
        );
    }
}


export default Docs;
